description:
Final Cut: Death on the Silver Screen Collectors Edition - Wendy99


Genre: Adventure | Hidden Object | Puzzle


Save your brother and try to solve the mystery behind the silver screen in Final 
Cut Death on the Silver Screen! Your father was one of the greatest movie directors of all time, until he was found murdered inside his mansion in Princeton, New 
Jersey. His mysterious murderer who seems to know even the deepest secrets of your family, demands that you find and hand over a secret your father left behind. The murderer believes that only you can unlock the path that leads to this secret. If 
you do not cooperate, your brother will pay the same price. Can you save your 
brother before the final cut?

This is a special Collectors Edition release full of exclusive extras you would not find in the standard version


The Collectors Edition includes: 

* Concept Art
* Wallpapers
* Soundtrack
* Bonus Gameplay


System Requirements:

OS: Windows XP/Windows Vista/Windows 7
CPU: 1.4 GHz
RAM: 1024 MB
DirectX: 8.0
Hard Drive: 845 MB


